import './hero.css'
import Backimg from './arsabela1.jpg'
function Hero() {
    function Welcome(props) {
        return <h1>Hello, {props.name}</h1>;
    }
    return (      
        <header className="layout-header anim-start-header" id="layout-100vh">
            <figure>
                <img src={Backimg} alt="web dev"/>
            </figure>
            <div>
                <Welcome name="React"/>
                <h1>My Best friends in React components</h1>
                <p>Example website with React components</p>
            </div>
        </header>   
        );
   }
export default Hero
